func bytes(from hex: String) -> [UInt8] {
	var bytes = [UInt8]()
	var cursor = hex.startIndex
	while cursor < hex.endIndex {
		let nextCursor = hex.index(cursor, offsetBy: 2)
		bytes.append(UInt8(hex[cursor..<nextCursor], radix: 16)!)
		cursor = nextCursor
	}
	return bytes
}
